import gmpy2
def fermatfactor(n):
    a = gmpy2.isqrt(n)+1
    b = a*a-n
    while not gmpy2.is_square(b):
        a = a+1
        if(a%2!=0):
            b = a*a-n
    b = gmpy2.isqrt(b)
    return(a+b, a-b)
	
def calc_d(p, q, e=65537):
	phi = (p-1) * (q-1)
	d = gmpy2.invert(e, phi)
